package cn.finder.wae.global.api.domain;import java.util.Date;import cn.finder.httpcommons.ApiObject;/**** 资源文件添加返回数据*/public class Media extends ApiObject{		private	String	media_id;		private String file_type;		private String name;		private Date create_time;	public String getMedia_id() {		return media_id;	}	public void setMedia_id(String media_id) {		this.media_id = media_id;	}	public String getFile_type() {		return file_type;	}	public void setFile_type(String file_type) {		this.file_type = file_type;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public Date getCreate_time() {		return create_time;	}	public void setCreate_time(Date create_time) {		this.create_time = create_time;	}		}